import React from 'react'
//NEXT Js Routing
import Link from 'next/link'

const ErrorBoundar = () => {
	return (
		<div>
			<h1>Something went wrong</h1>

			<Link href="/">
				<a>Go back</a>
			</Link>

		</div>
	)
}

export default ErrorBoundar;
